function findMatch(prefix){
	var _prefix = prefix.toLowerCase();
	console.log(_prefix);
    if (_prefix.length === 0) { return []; }
    if(gherkinSamples[_prefix]) { return gherkinSamples[_prefix]; }
    if(_prefix === "and") { return _.flatten(_.values(gherkinSamples)); }
    return [];
}